          <p style="font-size:16px;text-align:center;line-height:28px;"><span style="color:#000000;">温馨提示：</span></p><p style="font-size:12px;text-align:left;"><span style="color:#797979;">1.根据我国《合同法》、《电子签名法》以及其他相关法律法规，电子合同与纸质合同具有同等法律效应。</span></p><p style="font-size:12px;"><span style="color:#797979;">2.合同是当事人基于信任，在协商的基础上意思表示一致的民事法律行为。合同履行过程中所承担的风险将由合同当事人自行承担，因此签署前请务必确认标的物之真实性及合同内容，谨慎处理。</span></p><p style="font-size:12px;"><span style="color:#797979;"><br></span></p><p style="font-size:16px;text-align:center;line-height:24px;"><span style="color:#515151;"><br></span></p>
